import React from 'react';
import './Header.css';
import {NavLink} from "react-router-dom";


const Header = () => {
    return (
    <header className='header'>
    <img src="logo192.png"></img>
        <div className={login-block}>
            <NavLink to ={'/login'}>Login</NavLink>
        </div>
    </header>
    )
}

export default Header;
